import React, { useEffect } from 'react'
import axios from 'axios'

const Evolution = ({evolution_chain}) => {
    useEffect(() => {
        axios.get(evolution_chain)
            .then(res => {
                console.log(res)
            })
    })

    return null
}

export default Evolution
